import React from "react";
import {
  Card,
  CardContent,
  Typography,
  Paper,
  Box,
} from "@mui/material";
import ExistingTableComponent from "./ExistingTableComponent"; // Import your existing table component

const ModernCardTable = () => {
  return (
    <Box sx={{ display: "flex", justifyContent: "space-between", gap: 2, mt: 5, px: 2 }}>
      <Card sx={{ maxWidth: 600, boxShadow: 3, borderRadius: 2, flex: 1, overflow: "hidden" }}>
        <CardContent>
          <Typography variant="h5" gutterBottom>
            User Information 1
          </Typography>
          <Paper sx={{ boxShadow: 1, borderRadius: 1, overflow: "auto", maxWidth: "100%", maxHeight: 400 }}>
            <ExistingTableComponent />
          </Paper>
        </CardContent>
      </Card>
      
      <Card sx={{ maxWidth: 600, boxShadow: 3, borderRadius: 2, flex: 1, overflow: "hidden" }}>
        <CardContent>
          <Typography variant="h5" gutterBottom>
            User Information 2
          </Typography>
          <Paper sx={{ boxShadow: 1, borderRadius: 1, overflow: "auto", maxWidth: "100%", maxHeight: 400 }}>
            <get />
          </Paper>
        </CardContent>
      </Card>
    </Box>
  );
};

export default ModernCardTable;
